drop schema if exists NationalKensingtonBank; 
 create schema NationalKensingtonBank; 
 use NationalKensingtonBank; 
 SET NAMES utf8; 
 SET FOREIGN_KEY_CHECKS = 0; 
 SET AUTOCOMMIT=0;
 CREATE TABLE `CUSTOMER` (
	`CUSTOMER_ID` int(11) NOT NULL,
	`ADDRESS_ID` int(11) NOT NULL,
	`BRANCH_ID` int(11) NOT NULL,
	`TITLE` varchar(255) NOT NULL,
	`FIRST_NAME` varchar(255) NOT NULL,
	`INITIAL` varchar(255) NOT NULL,
	`SURNAME` varchar(255) NOT NULL,
	`HOME_PHONE` varchar(255) NOT NULL,
	`MOBILE_PHONE` varchar(255) NOT NULL,
	`EMAIL` varchar(255) NOT NULL,
	`MOTHERS_MAIDEN_NAME` varchar(255) NOT NULL,
	`DATE_OF_BIRTH` varchar(255) NOT NULL,
	`GENDER` varchar(255) NOT NULL,
	`NATIONAL-INSURANCE-NO` varchar(255) NOT NULL,
	`OCCUPATION` varchar(255) NOT NULL,
	PRIMARY KEY (`CUSTOMER_ID`)
	,KEY `ADDRESS_ID` (`ADDRESS_ID`)
	,KEY `BRANCH_ID` (`BRANCH_ID`)
	,CONSTRAINT `CUSTOMER_ADDRESS_ID` FOREIGN KEY (`ADDRESS_ID`) REFERENCES `ADDRESS` (`ADDRESS_ID`)
	,CONSTRAINT `CUSTOMER_BRANCH_ID` FOREIGN KEY (`BRANCH_ID`) REFERENCES `BRANCH` (`BRANCH_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `ADDRESS` (
	`ADDRESS_ID` int(11) NOT NULL,
	`LINE_1` varchar(255) NOT NULL,
	`LINE_2` varchar(255) NOT NULL,
	`LINE_3` varchar(255) NOT NULL,
	`POSTCODE` varchar(255) NOT NULL,
	PRIMARY KEY (`ADDRESS_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `BANK` (
	`BANK_ID` int(11) NOT NULL,
	`BANK` varchar(255) NOT NULL,
	PRIMARY KEY (`BANK_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `TRANSACTION-TYPE` (
	`TRANSACTION-TYPE_ID` int(11) NOT NULL,
	`TRANSACTION-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`TRANSACTION-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `ACCOUNT-STATUS-TYPE` (
	`ACCOUNT-STATUS-TYPE_ID` int(11) NOT NULL,
	`ACCOUNT-STATUS-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`ACCOUNT-STATUS-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `ACCOUNT-TYPE` (
	`ACCOUNT-TYPE_ID` int(11) NOT NULL,
	`ACCOUNT-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`ACCOUNT-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `BRANCH` (
	`BRANCH_ID` int(11) NOT NULL,
	`ADDRESS_ID` int(11) NOT NULL,
	`BANK_ID` int(11) NOT NULL,
	PRIMARY KEY (`BRANCH_ID`)
	,KEY `ADDRESS_ID` (`ADDRESS_ID`)
	,KEY `BANK_ID` (`BANK_ID`)
	,CONSTRAINT `BRANCH_ADDRESS_ID` FOREIGN KEY (`ADDRESS_ID`) REFERENCES `ADDRESS` (`ADDRESS_ID`)
	,CONSTRAINT `BRANCH_BANK_ID` FOREIGN KEY (`BANK_ID`) REFERENCES `BANK` (`BANK_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `ACCOUNT` (
	`ACCOUNT_ID` int(11) NOT NULL,
	`SORT-CODE` varchar(255) NOT NULL,
	`ACCOUNT-NUMBER` varchar(255) NOT NULL,
	`ACCOUNT-STATUS_ID` int(11) NOT NULL,
	`ACCOUNT-TYPE_ID` int(11) NOT NULL,
	`CUSTOMER_ID` int(11) NOT NULL,
	`BALANCE` varchar(255) NOT NULL,
	PRIMARY KEY (`ACCOUNT_ID`)
	,KEY `ACCOUNT-STATUS_ID` (`ACCOUNT-STATUS_ID`)
	,KEY `ACCOUNT-TYPE_ID` (`ACCOUNT-TYPE_ID`)
	,KEY `CUSTOMER_ID` (`CUSTOMER_ID`)
	,CONSTRAINT `ACCOUNT_ACCOUNT-STATUS_ID` FOREIGN KEY (`ACCOUNT-STATUS_ID`) REFERENCES `ACCOUNT-STATUS` (`ACCOUNT-STATUS_ID`)
	,CONSTRAINT `ACCOUNT_ACCOUNT-TYPE_ID` FOREIGN KEY (`ACCOUNT-TYPE_ID`) REFERENCES `ACCOUNT-TYPE` (`ACCOUNT-TYPE_ID`)
	,CONSTRAINT `ACCOUNT_CUSTOMER_ID` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `CUSTOMER` (`CUSTOMER_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `TRANSACTION` (
	`TRANSACTION_ID` int(11) NOT NULL,
	`ACCOUNT-NUMBER_ID` int(11) NOT NULL,
	`MERCHANT_ID` int(11) NOT NULL,
	`TRANSACTION-TYPE_ID` int(11) NOT NULL,
	`TRANSACTION-DATE` datetime NOT NULL,
	`TRANSACTION-AMOUNT` varchar(255) NOT NULL,
	PRIMARY KEY (`TRANSACTION_ID`)
	,KEY `ACCOUNT-NUMBER_ID` (`ACCOUNT-NUMBER_ID`)
	,KEY `MERCHANT_ID` (`MERCHANT_ID`)
	,KEY `TRANSACTION-TYPE_ID` (`TRANSACTION-TYPE_ID`)
	,CONSTRAINT `TRANSACTION_ACCOUNT-NUMBER_ID` FOREIGN KEY (`ACCOUNT-NUMBER_ID`) REFERENCES `ACCOUNT-NUMBER` (`ACCOUNT-NUMBER_ID`)
	,CONSTRAINT `TRANSACTION_MERCHANT_ID` FOREIGN KEY (`MERCHANT_ID`) REFERENCES `MERCHANT` (`MERCHANT_ID`)
	,CONSTRAINT `TRANSACTION_TRANSACTION-TYPE_ID` FOREIGN KEY (`TRANSACTION-TYPE_ID`) REFERENCES `TRANSACTION-TYPE` (`TRANSACTION-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `MERCHANT` (
	`MERCHANT_ID` int(11) NOT NULL,
	`MERCHANT` varchar(255) NOT NULL,
	PRIMARY KEY (`MERCHANT_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `POLICY-TYPE` (
	`POLICY-TYPE_ID` int(11) NOT NULL,
	`POLICY-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`POLICY-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `POLICY` (
	`POLICY_ID` int(11) NOT NULL,
	`POLICY-TYPE_ID` int(11) NOT NULL,
	`POLICY-NUMBER` varchar(255) NOT NULL,
	`CUSTOMER_ID` int(11) NOT NULL,
	`START-DATE` datetime NOT NULL,
	`END-DATE` datetime NOT NULL,
	`PREMIUM` varchar(255) NOT NULL,
	PRIMARY KEY (`POLICY_ID`)
	,KEY `POLICY-TYPE_ID` (`POLICY-TYPE_ID`)
	,KEY `CUSTOMER_ID` (`CUSTOMER_ID`)
	,CONSTRAINT `POLICY_POLICY-TYPE_ID` FOREIGN KEY (`POLICY-TYPE_ID`) REFERENCES `POLICY-TYPE` (`POLICY-TYPE_ID`)
	,CONSTRAINT `POLICY_CUSTOMER_ID` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `CUSTOMER` (`CUSTOMER_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `CAR_POLICY` (
	`CAR_POLICY_ID` int(11) NOT NULL,
	`POLICY_ID` int(11) NOT NULL,
	`MAKE` varchar(255) NOT NULL,
	`MODEL` varchar(255) NOT NULL,
	`REGISTRATION` varchar(255) NOT NULL,
	PRIMARY KEY (`CAR_POLICY_ID`)
	,KEY `POLICY_ID` (`POLICY_ID`)
	,CONSTRAINT `CAR_POLICY_POLICY_ID` FOREIGN KEY (`POLICY_ID`) REFERENCES `POLICY` (`POLICY_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `MORTGAGE-TYPE` (
	`MORTGAGE-TYPE_ID` int(11) NOT NULL,
	`MORTGAGE-TYPE` varchar(255) NOT NULL,
	PRIMARY KEY (`MORTGAGE-TYPE_ID`)
) ENGINE = InnoDB;
 CREATE TABLE `MORTGAGE` (
	`MORTGAGE-NUMBER` int(11) NOT NULL,
	`CUSTOMER_ID` int(11) NOT NULL,
	`ADDRESS_ID` int(11) NOT NULL,
	`MORTGAGE-TYPE_ID` int(11) NOT NULL,
	`START-DATE` datetime NOT NULL,
	`END-DATE` datetime NOT NULL,
	`RATE` varchar(255) NOT NULL,
	PRIMARY KEY (`MORTGAGE-NUMBER`)
	,KEY `CUSTOMER_ID` (`CUSTOMER_ID`)
	,KEY `ADDRESS_ID` (`ADDRESS_ID`)
	,KEY `MORTGAGE-TYPE_ID` (`MORTGAGE-TYPE_ID`)
	,CONSTRAINT `MORTGAGE_CUSTOMER_ID` FOREIGN KEY (`CUSTOMER_ID`) REFERENCES `CUSTOMER` (`CUSTOMER_ID`)
	,CONSTRAINT `MORTGAGE_ADDRESS_ID` FOREIGN KEY (`ADDRESS_ID`) REFERENCES `ADDRESS` (`ADDRESS_ID`)
	,CONSTRAINT `MORTGAGE_MORTGAGE-TYPE_ID` FOREIGN KEY (`MORTGAGE-TYPE_ID`) REFERENCES `MORTGAGE-TYPE` (`MORTGAGE-TYPE_ID`)
) ENGINE = InnoDB;
